import React from 'react';
import ReactDOM from 'react-dom'; // Add this line
import MapComponent from './MapComponent.js';

const MapRedirectButton = ({ startingPosition, destinationPosition }) => {
  const redirectToMap = () => {
    // You can use the window.location.href to redirect to a map or any other desired navigation method
    // window.location.href = `https://maps.example.com/?start=${startingPosition}&dest=${destinationPosition}`;
    window.location.href = ` https://www.google.com/maps/dir/Hilsa+Khaba,+13,+Lalit+Mitra+Ln,+Fariapukur,+Shyam+Bazar,+Kolkata,+West+Bengal+700004/Patna,+Bihar/@24.0884269,85.4366766,8z/data=!3m1!4b1!4m14!4m13!1m5!1m1!1s0x3a02779d16fb21bd:0x47acd4a91f523ca1!2m2!1d88.3748016!2d22.5995804!1m5!1m1!1s0x39f29937c52d4f05:0x831a0e05f607b270!2m2!1d85.1375645!2d25.5940947!3e3?entry=ttu`;

  };

  return (
    <button onClick={redirectToMap} className="btn btn-primary">
      Show Map
    </button>
  );
};
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <MapComponent/>
  </React.StrictMode>
);


export default MapRedirectButton;
